      "ingredients_text_fr_ocr_1550322828_result": "64% choucroute cuisin\u00e9e (choucroute, bouillon (eau, saindoux, 1% Riesling dlAlsace (sulfites), ar\u00f4me naturel, se , 0,1% baies de geni\u00e8vre, antioxydant : acide ascorbique)), 11% kna sup\u00e9 - rieure (viande de porc (origine France), eau, viande de b\u0153uf (origine UE), gras de porc, sel, plasma d\u00e9shydrat\u00e9, stabilisants : dipho phates, triphosphates ; dextrose, \u00e9pices et extrait d'\u00e9pices, ar\u00f4mes paturels, antioxydants : acide ascorbique, ascorbate de sodium ; conservateur : nitrite de sodium. Boyau naturel de mouton), 8% saucisse cuite sup\u00e9 - rieure fum\u00e9e (viande de porc (origine France), eau, sel, dextrose, \u00e9pices, plantes, stabilisants : diphosphates et triphosphates ; antioxy - dant : acide ascorbique ; sucre, 'conservateur : nitrite de sodium , ar\u00f4mes naturels, poireau. Boyau naturel de porc), 6% pommes de terre cuites (pommes de terre, eau, sel), 6% filet de porc cuit sup\u00e9 - rieur (filet de porc (origine France), eau, sel, ar\u00f4mes naturels, dex - trose, sucre, plantes aromatiques, bouillon d\u00e9shydrat\u00e9 (extraits de carottes, poireaux, liv\u00e8che, aromates), antioxydant : \u00e0scorbate de sodium, conservateur : nitrite de sodium), 5% poitrine de porc cuite sup\u00e9rieure fum\u00e9e (poitrine de porc (origine France), eau, sel, dextrose, antioxydant : ascorbate de sodium ; conservateur : nitrite de sodium), fum\u00e9e de bois de h\u00eatre. Pourcentages exprim\u00e9s sur la totalit\u00e9 du pro - duit. Traces \u00e9ventuelles de lait, de moutarde, de c\u00e9r\u00e9ales contenant dugluten, dl\u0153ufs et de fruits \u00e0 coque. Conseil de pr\u00e9paration (\u00e0 la casserole) : disposez la choucroute sans son sachet, les saucisses fum\u00e9es et les pommes de terre dans une casserole. Ajoutez un demi verre dleau, couvrez et chauffez pendant 15 minutes. Ajoutez le reste de la garniture, arrosez \u00e9ventuellement dlun demi verre de vin blanc et laissez cuire doucement pendant 10 minutes.",
