      "ingredients_text_fr_ocr_1562835509": "Ingr\u00e9dients : Choucroute cuisin\u00e9e 61% : Choucroute, bouillon (jus de cuisson, huile de tournesol, bi\u00e8re (dont malt d'ORGE), ar\u00f4me naturel, oignons), sel, antioxydant : acide ascorbique. Garniture carn\u00e9e 26% : viande de porc*, poitrine de porc*, eau, viande de boeuf*, gras de porc*, sel plasma d\u00e9shydrat\u00e9, \u00e9pices, plantes aromatiques et extraits d'\u00e9pices, ar\u00f4mes naturels, dextrose, saccharose, poireau, stabilisants : diphosphates et triphosphates, antioxydants : acide ascorbique et ascorbate de sodium, conservateur : nitrite de sodium. Boyaux naturels de porc et de mouton. Fum\u00e9e au bois de h\u00eatre. Pommes de terre cuites 13% pommes de terre, eau, sel. *Origine UE. Pr\u00e9sence \u00e9ventuelle de lait, gluten, moutarde, oeuf et fruits \u00e0 coque.",
