      "ingredients_text_fr_ocr_1546019104_result": "Choucroute au riesling d'Alsace (51,2%): choucroute, graisse de canard 1,5%, Riesling d'Alsace 1%, oignons, sel, baie de geni\u00e8vre moulues, poivre, laurier, antioxydant : acide ascorbique.\r\nKnack d'Alsace (13,4%): viande de porc*, eau, viande de boeuf*, gras de porc*, sel, plasma d\u00e9shydrat\u00e9, stabilisants: diphosphates et triphosphates, dextrose, \u00e9pices et extrait d'\u00e9pices, ar\u00f4mes naturels, antioxydants : acide ascorbique, ascorbate de sodium, conservateur: nitrite de sodium. Boyau naturel de mouton. Pomme de terre cuite (9,8%): pomme de terre, eau, sel. Saucisse fum\u00e9e cuite (9,8%): viande de porc*, eau, sel, \u00e9pices et plante aromatique (dont MOUTARDE), sirop de glucose, dextrose, antioxydants: acide ascorbique et ascorbate de sodium, conservateur : nitrite de sodium, ar\u00f4mes naturels. Boyau naturel de porc. Kassler fum\u00e9 cuit (7,3%): filet de porc*, eau, sel, dextrose, stabilisants : diphosphates et triphosphates, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium. Poitrine fum\u00e9e cuite (6,1%): poitrine de porc* , eau, sel, dextrose, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium. Moutarde au riesling (2,4%): eau, graines de MOUTARDE, vinaigre, Riesling 0,1% (SULFITES), sel, conservateur: SULFITE acide de sodium. Fum\u00e9 au bois de h\u00eatre. Pourcentage exprim\u00e9 sur le total de la choucroute garnie. *Origine UE\r\nRecette pr\u00e9par\u00e9e dans un atelier qui utilise \u00e9galement du gluten, des oeufs, de la moutarde, du lait et des fruits \u00e0 coque.",
