      "ingredients_text_debug": "Ingr\u00e9dients : choucroute cuisin\u00e9e 56,8%: choucroute, bouillon (jus de cuisson, huile de tournesol, bi\u00e8re 1% (dont malt d\u2019ORGE), ar\u00f4me naturel, oignons), sel, antioxydant :  acide ascorbique.\r\nknack d'Alsace 14,9% : viande de porc*, eau, viande de b\u0153uf*, gras de porc*, sel, plasma d\u00e9shydrat\u00e9, stabilisants :  diphosphates  et triphosphates, dextrose, \u00e9pices et extrait d'\u00e9pices, ar\u00f4mes naturels,antioxydants :  acide ascorbique, ascorbate de sodium, conservateur :  nitrite de sodium. Boyau naturel de mouton. Saucisse fum\u00e9e d'Alsace cuite 10,8% : viande de porc*, eau, sel, dextrose, \u00e9pices et plantes aromatiques, stabilisants :  diphosphates et triphosphates, antioxydant :  acide ascorbique, sucre, conservateur :  nitrite de sodium, ar\u00f4mes naturels, poireau. Boyau naturel de porc. Pomme de terre cuite 10,8% : pomme de terre, eau, sel. Poitrine fum\u00e9e cuite 6,8% : poitrine de porc*, eau, sel, dextrose, antioxydant :  ascorbate de sodium, conservateur :  nitrite de sodium. Fum\u00e9 au bois de h\u00eatre. Pourcentages exprim\u00e9s sur le total de la choucroute garnie. * Origine UE.\r\nPr\u00e9sence \u00e9ventuelle de moutarde, lait, oeuf, gluten et fruits \u00e0 coque.",
