      "complete": 1,
      "ingredients_text": "Choucroute cuisin\u00e9e 58,3% [chou 48,5%, bouillon (jus de cuisson, graisse d'oie 2%, vin blanc d'Alsace Riesling 1%, ar\u00f4me naturel), sel, baies de geni\u00e8vre, antioxydant : acide ascorbique], knack sup\u00e9rieure 15,3% [viande de porc, eau, viande de b\u0153uf, gras porc, sel, plasma de b\u0153uf d\u00e9shydrat\u00e9, \u00e9pices et plantes aromatiques (ail, cardamome, carvi, coriandre,gingembre, macis, muscade, oignon, piment, poivre), ar\u00f4mes naturels, sirop de glucose, dextrose, antioxydants : acide ascorbique et ascorbate de sodium, conservateur : nitrite de sodium, boyau naturel de mouton], saucisse cuite sup\u00e9rieure fum\u00e9e au bois de h\u00eatre 11,1% [viande de porc, eau, sel, ar\u00f4mes naturels, dextrose, \u00e9pices et plantes aromatiques (coriandre, ail, cumin, paprika, cannelle, girofle, oignon), antioxydant : acide ascorbique, sucre, conservateur : nitrite de sodium, poireau, boyau naturel de porc], saucisson \u00e0 l'ail sup\u00e9rieur fum\u00e9 au bois de h\u00eatre 8,3% [viande de porc, eau, gras de porc, sel, ar\u00f4mes naturels, plasma d\u00e9shydrat\u00e9, \u00e9pices et plantes aromatiques (poivre, coriandre), acidifiant : citrate de potassium, sirop de glucose, ail d\u00e9shydrat\u00e9 0,01%, antioxydants : acide ascorbique et ascorbate de sodium, conservateur : nitrite de sodium, colorant : carmins), poitrine cuite sup\u00e9rieure fum\u00e9e au bois de h\u00eatre trait\u00e9e en salaison 7% (poitrine de porc, eau, sel, dextrose, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium).\nPourcentages exprim\u00e9s sur l'ensemble du produit.",
