      "ingredients_text_with_allergens_fr": "Choucroute (46 %).\r\nGarniture (32 %) : viande de porc trait\u00e9e en salaison pr\u00e9cuite (13,5 %)(viande de porc, eau, sel, stabilisant : E451, g\u00e9lifiant : E407a, conservateur : E250), saucisses fum\u00e9es (6,5 %)(maigre de t\u00eate de porc, viande de porc, gras et couenne de porc, eau, plasma de porc, sel, stabilisant : E451, piment doux, g\u00e9lifiant : E412, E415, E407, sirop de glucose d\u00e9shydrat\u00e9, sucre, ar\u00f4mes, antioxydant : E300, conservateur : E250), saucisses pur porc fum\u00e9es (6,5 %)(viande de porc, eau, plasma de porc, sel, ar\u00f4me (dont <span class=\"allergen\">bl\u00e9</span> et <span class=\"allergen\">lait</span>), stabilisant : E451, sirop de glucose d\u00e9shydrat\u00e9, conservateur : E250), saucisson pur porc fum\u00e9 (5,5 %)(viande de porc, plasma de porc, maigre de t\u00eate de porc, gras de porc, sel, eau, sirop de glucose d\u00e9shydrat\u00e9, stabilisant : E451, ar\u00f4mes, antioxydant : E300, conservateur : E250).\r\nJus cuisin\u00e9 : eau, vin blanc Riesling (1 %), sel, antioxydant : E300, ar\u00f4me.\r\nSaindoux. Graines de cumin, baies de geni\u00e8vre et grains de poivre.",
