      "ingredients_text_with_allergens_fr": "Choucroute cuisin\u00e9e 54%: choucroute, saindoux,vin blanc d\u2018Alsace : Riesling 2%, sel, ar\u00f4me, baies de geni\u00e8vre, antioxydant: acide ascorbique, feuilles de laurier, Knack sup\u00e9rieure 14,9%: viande de porc; gras de porc; eau; viande de b\u0153uf; plasma de porc; <span class=\"allergen\">lactose</span>; stabilisants: diphosphates, polyphosphates; \u00e9pices (dont <span class=\"allergen\">moutarde</span>); ar\u00f4mes naturels; antioxydants: acide ascorbique, ascorbate de sodium; dextrose; sel ; conservateur: nitrite de sodium ; boyau naturel de mouton. Saucisse fum\u00e9e cuite 10,8%: viande de porc; eau ; sel ; dextrose ; stabilisants : diphosphates, triphosphates ; \u00e9pices et plantes aromatiques ; antioxydant :acide ascorbique ; sucre ; conservateur: nitrite de sodium; ar\u00f4mes naturels; poireau; boyau naturel de porc. Filet de porc cuit fum\u00e9 8,1%: filet de porc ; eau ;sel ; dextrose ; stabilisants: diphosphates, triphosphates ; antioxydant: ascorbate de sodium;  conservateur: nitrite de sodium ; ar\u00f4mes naturels. Poitrine fum\u00e9e cuite 6,7% : poitrine de porc, eau, sel, dextrose, antioxydant: ascorbate de sodium, conservateur : nitrite de sodium. Pomme de terre cuite 5,5% : pomme de terre, eau.",
