      "ingredients_text_fr": "L\u00e9gumes : Choucroute 44 % (chou, sel), pommes de terre (_sulfites_) 7 %. Charcuterie 16 % (saucisse de Strasbourg, saucisse, saucisson) : viande de porc, eau, viandes s\u00e9par\u00e9es m\u00e9caniquement de volaille et de porc, gras, maigre de t\u00eate et parures de porc, plasma de porc, farine de bl\u00e9, amidon transform\u00e9 de pommes de terre, conservateur : sel nitrit\u00e9, stabilisant : polyphosphates, g\u00e9lifiants : (carragh\u00e9nanes, alginate de sodium), \u00e9paississant : farine de graines de caroube, \u00e9pices, sirop de glucose, ar\u00f4me (_lait_), sels min\u00e9raux, antioxydant : ascorbate de sodium.\r\nSauce cuisin\u00e9e : eau, Riesling 0,3 % (_sulfites_), sels min\u00e9raux, ar\u00f4mes, exhausteur de go\u00fbt : monoglutamate de sodium (glutamate monosodique).\r\nViande de porc 6,9 % : viande de porc, eau, plasma de porc, conservateur : sel nitrit\u00e9, sels min\u00e9raux, stabilisant : polyphosphates, ar\u00f4mes. Saindoux - Baies de geni\u00e8vre, graines de coriandre.",
