      "ingredients_text_with_allergens_fr": "Choucroute 52 % (chou, sel). \r\nGarniture pur porc 17,3 % : saucisses et saucisson fum\u00e9s (viande, eau, maigre de t\u00eate, gras et parure de porc, farine de <span class=\"allergen\">bl\u00e9</span>, plasma de porc, sel nitrit\u00e9, \u00e9pices, ar\u00f4me (<span class=\"allergen\">lait</span>), sel, ascorbate de sodium, ar\u00f4me de fum\u00e9e, fum\u00e9e liquide. \r\nSauce cuisin\u00e9e 16,5 % : eau, vin blanc 0,4 % (<span class=\"allergen\">sulfites</span>), sel, ar\u00f4mes (<span class=\"allergen\">gluten</span>), ascorbate de sodium, ar\u00f4me de fum\u00e9e. Viande de porc 7% (viande de porc, eau, plasma de porc, sel, polyphosphate, citrate de sodium, ar\u00f4mes, sel nitrit\u00e9, diac\u00e9tate de sodium). \r\nPommes de terre 4,9 % (stabilisant : polyphosphates). Saindoux. Baies de geni\u00e8vre et grains de poivre.",
