      "image_nutrition_thumb_url": "https://static.openfoodfacts.org/images/products/325/456/007/5528/nutrition_fr.9.100.jpg",
      "categories": "Conserves, Plats pr\u00e9par\u00e9s, Plats pr\u00e9par\u00e9s en conserve, Choucroutes, Choucroutes garnies, Choucroute garnie au vin blanc",
      "product_name_fr_debug_tags": [],
      "ingredients_text_with_allergens": "Choucroute 46%\r\nJus cuisin\u00e9 : eau, vin blanc 1%, sel, antioxydant : acide ascorbique, ar\u00f4me\r\nGarniture 22,2% : saucisses et saucisson fum\u00e9s 3,5% (gras et couenne de porc, eau, maigre de t\u00eate de porc, viande de dinde, plasma de porc, prot\u00e9ines de <span class=\"allergen\">bl\u00e9</span> (contient <span class=\"allergen\">gluten</span>), sel, amidon de pois, stabilisant : triphosphates, ar\u00f4mes, g\u00e9lifiants : carragh\u00e9nanes, gomme guar, gomme xanthane, sucre, sirop de glucose d\u00e9shydrat\u00e9, coriandre en poudre, colorant : al\u00e9or\u00e9sine de paprika sur huile de tournesol, antioxydant : acide ascorbique, conservateur : nitrite de sodium). Viande de porc trait\u00e9e en salaison et pr\u00e9cuite (viande de porc, eau, sel, stabilisant : triphosphate, g\u00e9lifiant : algues euch\u00e9ma transform\u00e9es, conservateur : nitrite de sodium).\r\nPomme de terre 5% (dont antioxydant : acide ascorbique, conservateur : <span class=\"allergen\">disulfite</span> de sodium), saindoux, baies de geni\u00e8vres et grains de poivre",
      "ingredients_text_fr": "Choucroute 46%\r\nJus cuisin\u00e9 : eau, vin blanc 1%, sel, antioxydant : acide ascorbique, ar\u00f4me\r\nGarniture 22,2% : saucisses et saucisson fum\u00e9s 3,5% (gras et couenne de porc, eau, maigre de t\u00eate de porc, viande de dinde, plasma de porc, prot\u00e9ines de _bl\u00e9_ (contient _gluten_), sel, amidon de pois, stabilisant : triphosphates, ar\u00f4mes, g\u00e9lifiants : carragh\u00e9nanes, gomme guar, gomme xanthane, sucre, sirop de glucose d\u00e9shydrat\u00e9, coriandre en poudre, colorant : al\u00e9or\u00e9sine de paprika sur huile de tournesol, antioxydant : acide ascorbique, conservateur : nitrite de sodium). Viande de porc trait\u00e9e en salaison et pr\u00e9cuite (viande de porc, eau, sel, stabilisant : triphosphate, g\u00e9lifiant : algues euch\u00e9ma transform\u00e9es, conservateur : nitrite de sodium).\r\nPomme de terre 5% (dont antioxydant : acide ascorbique, conservateur : _disulfite_ de sodium), saindoux, baies de geni\u00e8vres et grains de poivre",
