      "ingredients_text_fr": "Choucroute 46 %, eau, saucisses et saucisson fum\u00e9s 16 % (gras et couenne de porc, eau, maigre de t\u00eate de porc, viande de dinde, plasma de porc, prot\u00e9ines de bl\u00e9 (contient _gluten_), sel, amidon de pois, stabilisant : triphosphates, ar\u00f4mes naturel ; g\u00e9lifiants : carragh\u00e9nanes, gomme guar, gomme xanthane ; sucre, sirop de glucose d\u00e9shydrat\u00e9, coriandre en poudre, colorant : extrait de paprika, antioxydant : acide ascorbique, conservateur : nitrite de sodium), viande de porc trait\u00e9e en salaison et pr\u00e9cuite 6 % (viande de porc, eau, sel, stabilisant : triphosphates, g\u00e9lifiant : algues euchema transform\u00e9es, conservateur : nitrite de sodium), pommes de terre 5 % (pommes de terre, antioxydant : acide ascorbique, conservateur : _disulfite_ de sodium), saindoux, vin blanc 1 %, sel, antioxydant : acide ascorbique, ar\u00f4me naturel, baies de geni\u00e8vres et grains de poivre.\r\n\r\n",
