      "ingredients_text_debug": "Choucroute 46 % (chou blanc, sel), eau, viande de porc saumur\u00e9e pr\u00e9cuite 11 % (viande de porc, eau, sel, stabilisant :  triphosphates, g\u00e9lifiant :  algues Euchema transform\u00e9es, conservateur :  nitrite de sodium), saucisse pur porc fum\u00e9e 9,7 % (viande de porc, plasma concentr\u00e9 de porc, eau, sel, gras de porc, sirop de glucose, stabilisant :  triphosphates, poivre noir, muscade en poudre, ar\u00f4me naturel d'ail, boyau naturel de porc), saucisse fum\u00e9e 6,5 % (viande de porc, pi\u00e8ces de t\u00eate de porc, gras de porc avec couenne, eau, plasma concentr\u00e9 de porc, sel, stabilisant :  triphosphates, piment doux en poudre, g\u00e9lifiants :  gomme guar, gomme xanthane, carragh\u00e9nanes, sirop de glucose, sucre, ar\u00f4mes naturels, antioxydant :  acide ascorbique, conservateur :  nitrite de sodium), saucisson pur porc fum\u00e9 4,7 % (viande de porc, plasma concentr\u00e9 de porc, pi\u00e8ces de t\u00eate de porc, gras de porc, sel, eau, sirop de glucose, stabilisant :  triphosphates, ar\u00f4mes naturels, antioxydant :  acide ascorbique, conservateur :  nitrite de sodium), saindoux, vin blanc, sel, antioxydant :  acide ascorbique, ar\u00f4me naturel de poivre, grains de poivre, baies de geni\u00e8vre, graines de cumin.",
