      "ingredients_text_debug": "Choucroute (46 %). Garniture (32 %) : viande de porc trait\u00e9e en salaison pr\u00e9cuite (13,5 %)(viande de porc, eau, sel, stabilisant :   - e451 - , g\u00e9lifiant :   - e407a - , conservateur :   - e250 - ), saucisse pur porc fum\u00e9e (6,5 %)(viande de porc, eau, plasma de porc, sel, ar\u00f4me (dont _gluten_, _lait_), stabilisant :   - e451 - , sirop de glucose d\u00e9shydrat\u00e9, conservateur :   - e250 - ), saucisse fum\u00e9e (6,5 %)(maigre de t\u00eate de porc ; viande de porc ; gras et couenne de porc ; eau ; plasma de porc ; sel ; stabilisant :   - e451 -  ; piment doux ; g\u00e9lifiants :  gomme guar,gomme xanthane ; carragh\u00e9nanes ; sirop de glucose d\u00e9shydrat\u00e9 ; sucre ; ar\u00f4me naturel de poivre ; antioxydant :  acide ascorbique ; ar\u00f4me naturel d'ail ; ar\u00f4me naturel de muscade ; conservateur :   - e250 - ), rondelle de saucisson fum\u00e9 (5,5 %)(viande de porc, plasma de porc, maigre de t\u00eate de porc, gras de porc, eau, sel, sirop de glucose d\u00e9shydrat\u00e9, stabilisant :   - e451 - , ar\u00f4me naturel de poivre, antioxydant :  acide ascorbique, ar\u00f4me naturel d'ail, ar\u00f4me naturel de muscade, conservateur :   - e250 - ). Jus cuisin\u00e9 : eau, vin blanc Riesling (1 %), sel, antioxydant :  acide ascorbique, ar\u00f4me naturel de poivre. Saindoux. Baies de geni\u00e8vre, graines de cumin et grains de poivre.",
