      "ingredients_text_debug": "Choucroute cuisin\u00e9e 56,8% (choucroute 52% - saindoux - vin blanc d'Alsace Riesling 1,1% - sel - ar\u00f4me naturel - baies de geni\u00e8vre - antioxydant :  acide ascorbique - feuilles de laurier) - Knack fum\u00e9e de qualit\u00e9 sup\u00e9rieure14,9% (viande de porc 9,4% - eau - viande de b\u0153uf 1,7% - gras de porc - sel - plasma de boeuf d\u00e9shydrat\u00e9 - \u00e9pices et plantes aromatiques -  ar\u00f4mes naturels - sirop de glucose - dextrose - antioxydants :  acide ascorbique, ascorbate de sodium - conservateur :  nitrite de sodium. Boyau naturel de mouton) - saucisse fum\u00e9e cuite de qualit\u00e9 sup\u00e9rieure 10,8% (viande de porc - sel - dextrose - \u00e9pices et plantes aromatiques - stabilisants :  diphosphates, triphosphates - antioxydant :  acide ascorbique - sucre - conservateur :  nitrite de sodium - ar\u00f4mes naturels - poireau. Boyau naturel de porc - Pr\u00e9par\u00e9e avec 105 g de viande pour 100 g de saucisse fum\u00e9e) - pommes de terre cuites 10,8% (pommes de terre 9,7% - eau - sel) - poitrine fum\u00e9e cuite de qualit\u00e9 sup\u00e9rieure 6,7% (poitrine de porc 6,6% - eau - sel - dextrose - antioxydant :  ascorbate de sodium - conservateur :  nitrite de sodium). Traces de _c\u00e9r\u00e9ales contenant du gluten_, _fruits \u00e0 coque_, _lait_, _moutarde_ et _oeufs_. Viande de porc origine : UE - Viande de boeuf origine : France.",
