      "ingredients_text_with_allergens_fr": "Choucroute cuisin\u00e9e 54,3% : choucroute, saindoux, vin blanc d'Alsace : Riesling, sel, ar\u00f4me, baies de geni\u00e8vre, antioxydant : acide ascorbique, feuilles de laurier.\r\nPommes de terre cuites 13% : pommes de terre, eau.\r\nKnacks sup\u00e9rieures 12% : viande de porc ; gras de porc ; eau ; viande de boeuf  ; plasma de porc ; <span class=\"allergen\">lactose</span> ; stabilisants : diphosphates, polyphosphates ; \u00e9pices (dont <span class=\"allergen\">moutarde</span>) ; ar\u00f4mes naturels ; antioxydants : acide ascorbique, ascorbate de sodium ; dextrose ; sel ; conservateur : nitrite de sodium ; boyau naturel de mouton.\r\nSaucisses fum\u00e9es cuites 8,7%  : viande de porc ; eau ; sel ; dextrose ; stabilisants : diphosphates, triphosphates ; \u00e9pices et plantes aromatiques ; antioxydant : acide ascorbique ; sucre ; conservateur : nitrite de sodium ; ar\u00f4mes naturels ; poireau ; boyau naturel de porc.\r\nFilet de porc cuit fum\u00e9 6,5% : filet de porc ; eau ; sel ; dextrose ; antioxydant : ascorbate de sodium ; stabilisants : diphosphates, triphosphates ; conservateur : nitrite de sodium ; ar\u00f4mes naturels.\r\nPoitrine fum\u00e9e cuite 5,5% : poitrine de porc, eau, sel, dextrose, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium.",
