      "ingredients_text_debug": "Choucroute pr\u00e9cuite (42%). Charcuterie et viande (22%) : Saucisses et saucisson fum\u00e9s (viande et gras de porc, eau, viande de dinde, pi\u00e8ces de t\u00eate de porc, farine de BLE, couenne de porc, prot\u00e9ines de SOJA, sel, g\u00e9lifiant :   - e407a - , ar\u00f4mes naturels, \u00e9pices, stabilisants :   - e450 - ,  - e452 - ; conservateurs :   - e250 - ,  - e316 - ; traces de prot\u00e9ines de LAIT), viande de porc pr\u00e9par\u00e9e en salaison (eau, sel, stabilisants :   - e451 - ,  - e452 - ; conservateur :   - e250 - ). Jus cuisin\u00e9 (eau, vin blanc, sel, oignon \u00e9pice). Saindoux. Baies de geni\u00e8vre et graines de cumin. Allerg\u00e8nes : contient c\u00e9r\u00e9ales \u00e0 gluten (bl\u00e9), soja, lait",
