      "ingredients_text_with_allergens_fr": "Choucroute pr\u00e9cuite (42%). Charcuterie et viande (22%) : Saucisses et saucisson fum\u00e9s (viande et gras de porc, eau, viande de dinde, pi\u00e8ces de t\u00eate de porc, farine de <span class=\"allergen\"><span class=\"allergen\">BLE</span></span>, couenne de porc, prot\u00e9ines de <span class=\"allergen\"><span class=\"allergen\">SOJA</span></span>, sel, g\u00e9lifiant : E407a, ar\u00f4mes naturels, \u00e9pices, stabilisants : E450, E452; conservateurs : E250, E316; traces de prot\u00e9ines de <span class=\"allergen\"><span class=\"allergen\">LAIT</span></span>), viande de porc pr\u00e9par\u00e9e en salaison (eau, sel, stabilisants : E451, E452; conservateur : E250). Jus cuisin\u00e9 (eau, vin blanc, sel, oignon \u00e9pice). Saindoux. Baies de geni\u00e8vre et graines de cumin. Allerg\u00e8nes : contient c\u00e9r\u00e9ales \u00e0 gluten (<span class=\"allergen\">bl\u00e9</span>), <span class=\"allergen\">soja</span>, <span class=\"allergen\">lait</span>",
