      "ingredients_text_fr": "Choucroute cuisin\u00e9e 52,5% : choucroute, jus de cuisson, graisse d'oie (4%), Riesling (2%), sel, ar\u00f4me, baies de geni\u00e8vre, antioxydant : acide ascorbique.\r\nKnacks 13,8% : maigre et gras de porc, eau, maigre et gras de boeuf, plasma de porc, sel, \u00e9pices (dont _moutarde_), stabilisants : diphosphates et polyphosphates, _lactose_, ar\u00f4mes naturels, dextrose, antioxydants : acide ascorbique, ascorbate de sodium, conservateur : nitrite de sodium.\r\nBoyau naturel de mouton.\r\nSaucisse fum\u00e9e cuite 10% : maigre et gras de porc, eau, sel, dextrose, \u00e9pices et plantes aromatiques, stabilisants : diphosphates et triphosphates, antioxydant : acide ascorbique, sucre, conservateur : nitrite de sodium, ar\u00f4mes naturels, poireau.\r\nBoyau naturel de porc.\r\nPomme de terre 8,7% : pomme de terre, eau.\r\nSaucisson \u00e0 l'ail 7,5% : maigre et gras de porc, eau, blanc d'_oeuf_, sel, \u00e9pices (dont _moutarde_) et plante aromatique (ail d\u00e9shydrat\u00e9 0,4%), _lactose_, dextrose, stabilisants, diphosphates, triphosphates et polyphosphates, antioxydant : acide ascorbique, ar\u00f4mes naturels, conservateur : nitrite de sodium, colorants : carmins.\r\nFilet de porc cuit fum\u00e9 7,5% : filet de porc, eau, sel, dextrose, stabilisants : diphosphates et triphosphates, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium, ar\u00f4mes naturels.",
