      "ingredients_text_fr": "Choucroute cuisin\u00e9e 67%: chou 81%, jus de cuisson, graisse d'oie 4%, vin blanc d'Alsace Riesling 2%, sel, ar\u00f4me (dont _lait_), baies de geni\u00e8vre, antioxydant: acide ascorbique.\r\nKnacks 11%: viande de porc, eau, maigre de boeuf, sel, plasma de boeuf d\u00e9hydrat\u00e9, \u00e9pices et plantes aromatiques (ail, cardamome, carvi, coriandre, gingembre, macis, muscade, oignon, piment, poivre),ar\u00f4mes naturels, sirop de glucose de bl\u00e9 et/ou ma\u00efs, antioxydant: acide ascorbique et ascorbate de sodium, conservateur: nitrite de sodium, Boyau naturel de mouton,.\r\nSaucisses cuites fum\u00e9es au bois de h\u00eatre 8%: viande de porc, eau, sel, ar\u00f4mes naturels, dextrose de bl\u00e9 et/ou ma\u00efs, \u00e9pices et plantes aromatiques (coriandre, ail, cumin, paprika, cannelle, girofle, oignon), poireau, antioxydant: acide ascorbique, sucre, conservateur: nitrite de sodium, Boyau naturel de porc,.\r\nFilet de porc cuit, trait\u00e9 en salaison 6%:  coeur de filet de porc, eau, dextrose de bl\u00e9 et/ou ma\u00efs, sucre, plantes aromatiques (ail, oignons), ar\u00f4mes naturels, antioxydant: ascorbate de sodium, conservateur: nitrite de sodium,.\r\nPoitrine fum\u00e9e cuite, trait\u00e9 en salaison 5%:  poitrine de porc, eau, dextrose de bl\u00e9 et/ou ma\u00efs, antioxydant: ascorbate de sodium, conservateur: nitrite de sodium,.\r\n\r\nSaucisson \u00e0 l'ail fum\u00e9 au bois de h\u00eatre 3%: viande de porc, gras de porc, eau, sel, plasma de boeuf d\u00e9hydrat\u00e9, ar\u00f4mes naturels, ail d\u00e9hydrat\u00e9 0.2%, poivre, coriandre, sirop de glucose de bl\u00e9 et/ou ma\u00efs, acidifiant: citrate de potassium, antioxydant: acide ascorbique, ascorbate de sodium, conservateur: nitrite de sodium, colorant: carmin de cochenille,.",
