      "ingredients_text_debug": "Choucroute 38,2% (choux, sel, saindoux, vin blanc d'Alsace (_sulfites_), \u00e9pices, plantes aromatiques, baies de geni\u00e8vre, antioxydant :  acide ascorbique), _Hoki_ 17,6%(_poisson_), eau, _crevettes_ (_crevettes_, sel, sucre, antioxydant :  di_sulfite_ de sodium, acidifiant :  acide citrique), _cr\u00e8me_ liquide (dont stabilisant :  carragh\u00e9nanes), _colin_ fum\u00e9 fa\u00e7on haddock (_colin_ (Pollachius virens), colorant :  rocou, sel), _moules_ du Pacifique (Mytilus Chilensis), _amandes_ de mer, b\u00e9chamel d\u00e9shydrat\u00e9e (_lactos\u00e9rum_ en poudre, amidon modifi\u00e9, farine de _bl\u00e9_, sel, \u00e9pices (muscade, poivre)), huile de colza, \u00e9chalote, ar\u00f4me naturel (dont _mollusques_), persil, g\u00e9latine alimentaire (dont _sulfites_), sel, f\u00e9cule modifi\u00e9e, extrait de vin blanc (_sulfites_), graines de pavot, ail en poudre",
