      "preparation_fr": "Au micro-ondes : Ouvrez l'opercule sur 1/2 cm, mettez la garniture sur le chou et placez la barquette dans votre four \u00e0 micro-ondes. Faites r\u00e9chauffer environ 5 minutes \u00e0 600W. Ajustez le temps de r\u00e9chauffage suivant la puissance de votre four.\nA la casserole: Mettez la choucroute et la saucisse fum\u00e9e dans une casserole avec un peu d 'eau. Chauffez pendant 5 minutes puis ajoutez le reste de la garniture. Couvrez et laissez mijoter 5 minutes. \n\nA consommer cuit \u00e0 coeur. \nNe pas r\u00e9utiliser un produit d\u00e9j\u00e0 r\u00e9chauff\u00e9. Ne pas mettre la barquette au four traditionnel.",
