      "origins": "Viande de porc,France",
      "ingredients_text_with_allergens_fr": "Choucroute cuisin\u00e9e 57% (chou 47%, jus de cuisson, graisse d'oie 2%, vin blanc d'Alsace Riesling 1%, ar\u00f4me naturel, sel, baies de geni\u00e8vre, antioxydant : acide ascorbique), knack sup\u00e9rieure 16% (viande de porc 10%, eau, viande de b\u0153uf 2%, gras de porc, sel, plasma de boeuf d\u00e9shydrat\u00e9, \u00e9pices et plantes aromatiques (ail, cardamome, carvi, coriandre, gingembre, macis, muscade, oignon, piment, poivre), ar\u00f4mes naturels, sirop de glucose, dextrose, antioxydants : acide ascorbique et ascorbate de sodium, conservateur : nitrite de sodium. Boyau naturel de mouton), poitrine cuite sup\u00e9rieure, trait\u00e9e en salaison, fum\u00e9e au bois de h\u00eatre 14% (poitrine de porc 12%, eau, sel, dextrose, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium), saucisse cuite sup\u00e9rieure fum\u00e9e au bois de h\u00eatre 13% (viande de porc 107g pour 100g de saucisse, eau, sel, ar\u00f4mes naturels, dextrose, \u00e9pices et plantes aromatiques (coriandre, ail, cumin, paprika, cannelle, girofle, oignon), antioxydant : acide ascorbique, sucre,  poireau, conservateur : nitrite de sodium. Boyau naturel de porc).",
