      "other_information": "350g\n Laissez vous s\u00e9duire par un des fleurons de la cuisine alsacienne . Cette choucroute cuisin\u00e9e \u00e0 la graisse d'oie est compos\u00e9e d'un assortiment copieux de charcuterie dispos\u00e9 sur le chou cuisin\u00e9 au Riesling, qui vient renforcer la convivialit\u00e9 de ce plat. \nPicto 1 personne\nPicto micro_ondes 5 minutes\nSANS EXHAUSTEUR DE GOUT\nSANS COLORANT\nVIANDE DE PORC ET B\u0152UF ORIGINE France\nCHOU ORIGINE FRANCE\nSANS POLYPHOSPHATE *\n* CONFORMEMENT A LA REGLEMENTATION",
      "preparation": "Au micro-ondes : Ouvrez l'opercule sur 1/2 cm, mettez la garniture sur le chou et placez la barquette dans votre four \u00e0 micro-ondes. Faites r\u00e9chauffer environ 5 minutes \u00e0 600W. Ajustez le temps de r\u00e9chauffage suivant la puissance de votre four.\nA la casserole: Mettez la choucroute et la saucisse fum\u00e9e dans une casserole avec un peu d 'eau. Chauffez pendant 5 minutes puis ajoutez le reste de la garniture. Couvrez et laissez mijoter 5 minutes. \n\nA consommer cuit \u00e0 coeur. \nNe pas r\u00e9utiliser un produit d\u00e9j\u00e0 r\u00e9chauff\u00e9. Ne pas mettre la barquette au four traditionnel.",
