      "ingredients_text_with_allergens": "Choucroute cuisin\u00e9e 52.5% : choucroute, oignons frits (oignons, huile de tournesol ol\u00e9ique, huile de tournesol), saindoux, Riesling 1%*, graisse d'oie, sel, ar\u00f4mes naturels, baies de geni\u00e8vre, antioxydant : acide ascorbique. * pourcentage exprim\u00e9 par rapport \u00e0 la choucroute cuisin\u00e9e. Knack 13.75% : viande de porc (France), eau, viande bovine (France), gras de porc (France), sel, plasma d\u00e9shydrat\u00e9, \u00e9pices et plantes aromatiques, ar\u00f4mes naturels, sirop de glucose, dextrose, antioxydants : acide ascorbique, ascorbate de sodium, conservateur : nitrite de sodium. Boyau naturel de mouton. Pomme de terre cuite 10% : pomme de terre, eau. Saucisse fum\u00e9e cuite 10% : viande de porc (France), eau, sel, ar\u00f4mes naturels, dextrose, \u00e9pices et plantes aromatiques, antioxydant : acide ascorbique, sucre, conservateur : nitrite de sodium, poireau. Boyau naturel de porc. Filet de porc cuit, trait\u00e9 ensalaison 7.5% : filet de porc (France), eau, sel, dextrose, sucre, plantes aromatiques, ar\u00f4mes naturels, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium. Poitrine de porc trait\u00e9e en salaison cuite fum\u00e9e 6.25% : poitrine de porc (France), eau, sel, dextrose, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium. Fumage au bois de h\u00eatre.",
