      "ingredients_text": "Ingr\u00e9dients : Choucroute au riesling d'Alsace (52%): choucroute, graisse de canard 1,5%, riesling d'Alsace1%, oignons, sel, baies de geni\u00e8vre moulues, poivre, laurier, antioxydant : E300.\r\nPommes de terre cuites (12%): pommes de terre, eau, sel. Knacks d'Alsace (11%): viande de porc*, eau, viande de boeuf*, gras de porc*, sel, plasma deshydrat\u00e9, stabilisants: E450, E451, dextrose, \u00e9pices et extraits d'\u00e9pices, ar\u00f4mes naturels, antioxydants : E300, E301, conservateur: E250. Boyau naturel de mouton. Saucisses fum\u00e9es cuites (8%): viande de porc*, eau, sel, \u00e9pices et plante aromatique (dont MOUTARDE), sirop de glucose, dextrose, antioxydants: E300, E301, conservateur : E250, ar\u00f4mes naturels. Boyau naturel de porc. Saucisses paysannes (6%):viande de porc*, eau, sel, \u00e9pices et \r\nplantes aromatiques, plasma deshydrat\u00e9, ar\u00f4mes naturels, stabilisants : E450, E451, dextrose, antioxydants : E300, E301, conservateur : E250. Boyau naturel de mouton. Kassler fum\u00e9 cuit (6%): filet de porc*, eau, sel, dextrose, stabilisants : E450, E451, antioxydant : E301, conservateur : E250. Poitrine fum\u00e9e cuite (5%): poitrine de porc*, eau, sel, dextrose, antioxydant : E301, conservateur : E250. Fum\u00e9 au bois de h\u00eatre. Pourcentages exprim\u00e9s sur le total de la choucroute garnie. *Origine UE.\r\nRecette pr\u00e9par\u00e9e dans un atelier qui utilise \u00e9galement du gluten, des oeufs, du lait, de la moutarde et des fruits \u00e0 coque.",
