      "ingredients_text_with_allergens_fr": "CHOUCROUTE CUISINE 60% [choucroute, Saint doux Vin blanc d'Alsace, sel, sucre, aromates, antioxydant : E300, ar\u00f4me (dont fum\u00e9e)], CHARCU ERIE 27% [viande de porc, poitrine de porc,eau, sel , \u00e9pices et aromates (moutarde prot\u00e9ines v\u00e9g\u00e9tales de bl\u00e9, prot\u00e9ines de porc, sirop de glucose, <span class=\"allergen\">lactose</span>, dextrose, conservateurs : E250, E316, stabilisants : E450, E451 , antioxyd\u00e0nts : E3OO, E301, exhausteur de go\u00fbt E621, ar\u00f4mes (fum\u00e9e), colorant : E120 - boyaux naturels et collag\u00e8ne-fum\u00e9 au bois de h\u00eatre] de porc origine UE, POMMES de TERRE 13% conservateur E223 Traces possibles de <span class=\"allergen\">fruits \u00e0 coque</span> et <span class=\"allergen\">\u0153ufs</span>. Pour l\u2019enfant de moins de 4 ans, couper la saucisse dans le sens de la longeur puis en tous petits morceaux afin de pr\u00e9venir les risques d\u2019\u00e9touffement .",
