      "ingredients_text_debug": "ingredients : Choucroute au Riesling d'Alsace 56% : choucroute, graisse de canard 1,5%, Riesling d'Alsace 1%, oignons, sel, baies de geni\u00e8vre moulues, poivre, laurier, antioxydant :  acide \r\nascorbique. Pommes de terre cuites 10%: pommes de terre, eau, sel. Saucisses fum\u00e9es cuites 9,6%:  viande de porc*, eau, sel, \u00e9pices et plante aromatique (dont MOUTARDE), sirop de glucose, dextrose , antioxydants :  acide ascorbique et ascorbate de sodium, conservateur :  nitrite de sodium, ar\u00f4mes naturels. Boyau naturel de porc. Knacks d'Alsace 8,8%: viande de porc*, eau, viande de b\u0153uf*, gras de porc*, sel, plasma d\u00e9shydrat\u00e9, stabilisants :  diphosphates et triphosphates, dextrose, \u00e9pices et extrait d'\u00e9pices,  ar\u00f4mes naturels, antioxydants :  acide ascorbique, ascorbate de sodium, conservateur :  nitrite de sodium. Boyau naturel de mouton.Poitrine fum\u00e9e cuite 6%: poitrine de porc*, eau, sel, dextrose, antioxydant :  ascorbate de sodium, conservateur :  nitrite de sodium. Kassler fum\u00e9 cuit 4,8% : filet de porc*, eau, sel, dextrose, stabilisants :  diphosphates et triphosphates, antioxydants :  ascorbate de sodium, conservateur :  nitrite de sodium. Saucisses paysannes 4,8% : viande de porc*, eau, sel, \u00e9pices et \r\nplantes aromatiques, plasma d\u00e9shydrat\u00e9, ar\u00f4mes naturels, stabilisants :  diphosphates et triphosphates, dextrose, antioxydants :  acide ascorbique et ascorbate de sodium, conservateur :  nitrite de sodium. Boyau naturel de mouton. Fum\u00e9 au bois de h\u00eatre. Pourcentages exprim\u00e9s sur le total de la choucroute garnie. * Origine UE. Pr\u00e9sence possible de gluten, d'oeufs, de lait, de moutarde et de fruits \u00e0 coque.",
