      "preparation": "A la casserole : versez le contenu de la bo\u00eete dans une casserole et faites chauffer \u00e0 feu doux 15 minutes environ en remuant de temps en temps. En ajoutant un demi verre de vin blanc d'Alsace*, vous renforcerez la saveur de cette choucroute. \n\n* L'abus d'alcool est dangereux pour la sant\u00e9.\n\nAu four \u00e0 micro-ondes : versez la choucroute dans un plat adapt\u00e9, couvrez et faites r\u00e9chauffer 4 min \u00e0 puissance maximale (800 W) en remuant une fois la choucroute \u00e0 mi-cuisson.",
