      "ingredients_text_with_allergens_fr": "Choucroute cuisin\u00e9e 56 % : choucroute, jus de cuisson, graisse d'oie 2 %, Riesling 1 %, sel, ar\u00f4me, baies de geni\u00e8vre, antioxydant : acide ascorbique. Pommes de terre cuites 14 % : pommes de terre, eau, sel.\r\n\r\nKnacks 11% : viande de porc*, eau, viande de b\u0153uf*, gras de porc*, sel, plasma d\u00e9shydrat\u00e9, stabilisants : diphosphates et triphosphates, \u00e9pices et extrait d'\u00e9pices, ar\u00f4mes naturels, antioxydants : acide ascorbique, ascorbate de sodium, conservateur : nitrite de sodium - Boyau naturel de mouton.\r\n\r\nSaucisses fum\u00e9es cuites 8% : viande de porc*, eau, sel, dextrose, \u00e9pices et plantes aromatiques, stabilisants : diphosphates et triphosphates, antioxydant : acide ascorbique, sucre, conservateur : nitrite de sodium, ar\u00f4mes naturels, poireau - Boyau naturel de porc. Filet de porc fum\u00e9 cuit 6 % : filet de porc, eau, sel, dextrose, stabilisants : diphosphates et triphosphates, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium.\r\n\r\nPoitrine de porc fum\u00e9e cuite 5 % : poitrine de porc fum\u00e9e cuite*, eau, sel, dextrose, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium. Fum\u00e9 au bois de h\u00eatre.\r\n\r\nPourcentages exprim\u00e9s sur le total de la choucroute garnie. *Origine UE",
