      "ingredients_text_with_allergens": "Choucroute cuisin\u00e9e 64% : choucroute, jus de cuisson, saindoux, Riesling 2%*, ar\u00f4me naturel, sel, baies de geni\u00e8vre, antioxydant : acide ascorbique. * pourcentage exprim\u00e9 par rapport \u00e0 la choucroute cuisin\u00e9e. Knacks sup\u00e9rieures 11% : viande de porc (France), eau, viande bovine (France), gras de porc (France), sel, plasma d\u00e9shydrat\u00e9, \u00e9pices et plantes aromatiques, ar\u00f4mes naturels, sirop de glucose, dextrose, antioxydants : acide ascorbique, ascorbate de sodium, conservateur : nitrite de sodium. Boyau naturel de mouton. Saucisses fum\u00e9es cuites 8% : viande de porc (France), eau, sel, ar\u00f4mes naturels, dextrose, \u00e9pices et plantes aromatiques, antioxydant : acide ascorbique, sucre, conservateur : nitrite de sodium, poireau. Boyau naturel de porc. Pommes de terre cuites 6% : pommes de terre, eau. Filet de porc cuit, trait\u00e9 en salaison 6% : filet de porc (France), eau, sel, dextrose,  sucre, plantes aromatiques, ar\u00f4mes naturels, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium. Poitrine de porc trait\u00e9e en salaison cuite fum\u00e9e 5% : poitrine de porc (France), eau, sel, dextrose, antioxydant : ascorbate de sodium, conservateur : nitrite de sodium. Fumage au bois de h\u00eatre.",
