      "labels": "en:made-in-france",
      "ingredients_text_debug": "Choucroute 51 % (chou - sel) - \u00e9chine fum\u00e9e et poitrine de porc sal\u00e9e 18% (viande de porc - eau - conservateur :  sel nitit\u00e9 - dextrose de bl\u00e9 - sirop de , glucose de ma\u00efs - sucre : diphosphates, biphosphates - sel - ar\u00f4mes) hi pommes de terre cuites 15% (pommes de tere - eau) - saucisses de *bourg 6% de porc - viande de b\u0153uf - gras de porc - eau - conservateur :  sel nitit\u00e9 plasma - \u00e9pices - \u00e9chalote - acidifiant :  acide cifrique - lactose sel - stabilisanb : diptsphates, friphosphates - anioxydants : acide ascorbique, ascorbate de sodium - correcteur diacidit\u00e9 : glucono-delta-lactone - ar\u00f4mes - boyau naturel de mouton) - saucisse fum\u00e9e d'Asace 6% (viande de porc - gras de porc - viande de b\u0153uf - mervateur : set nitit\u00e9 - eau plasma - \u00e9pices \u00e9chalote - acidifiant :  acide citique - detose de bl\u00e9 - lactose - plantes aromatiques - sel - sfflisanb : diphosphates, tiphosphates - antoxydanb : acide ascorbique, ascorbate de sodium -- ar\u00f4mes et ar\u00f4me de fum\u00e9e - poireau en poudre cumin - boyau naturel de porc) : saindoux - Riesling 1,1% - sel - oignon poivre - cumin - ail - baie de geni\u00e8vre en poudre - : acide ascobique. Fabriqu\u00e9 en ftance\u00e0 de viandes origine : fin. Traces \u00e9veftelles de mouurde.",
